              const depthOfItem = (path.match(/~/g) || []).length - (model.rootPath.match(/~/g) || []).length - 1
                // return tds until depth and then the '>' sign, and then the headline
              return maxDepthAr.filter((e,i) => i < depthOfItem+3)
